import React from "react";


export function templateAnime({LinkComics, tituloComic}){
    return(
        <div>
            <iframe width="1268" height="713" src="https://www.youtube.com/embed/mOmczexloR8" title="HxH1" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    );
}

export default templateAnime;
